import React from 'react';
import { Link } from 'react-router-dom'

const Users = (props) => {

    const handleClick = () => {
        fetch('http://localhost:3001/logout', {
            method: 'DELETE',
            credentials: 'include'
        })
        .then(response => {
            props.handleLogout()
            props.history.push('/')
        })
        .catch(error => console.log(error))
    }

    return (
      <div>
         <Link to='/logout' onClick={handleClick}>Log Out</Link>
        {props.user.id}
      </div>
    );
  };

  export default Users;
